import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
  
        <a
          className="got-to-form-link"
          href="#"
          target="_blank"
          rel="noopener noreferrer"
        >
          Add your own data here
        </a>
      </header>
    </div>
  );
}

export default App;
